import React from 'react';
import './App.css';
import Cart from './cart/Cart.js'
import ListItems from './list-items/ListItems.js'
import itemsData from './dataFile'
import { setItemsToStore } from './actions/itemActions'
import { connect } from 'react-redux'
import { BrowserRouter, Route, Redirect, Switch } from 'react-router-dom';

class App extends React.Component {

  componentDidMount() {
    const { dispatchSetItemsToStore } = this.props
    dispatchSetItemsToStore(itemsData)
  }

  render() {
    return (
      <BrowserRouter>
        <Switch>
          <Route path='/list' component={ListItems} />
          <Route path='/cart' component={Cart} />
        </Switch>
      </BrowserRouter>
    )
  }
}

export const mapDispatchToProps = dispatch => ({
  dispatchSetItemsToStore: data => dispatch(setItemsToStore(data))
})

export default connect(null, mapDispatchToProps)(App)
